import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import useRoom from '../../hooks/useRoom';
import './RoomPage.css';

const RoomPage = () => {
  const { roomId } = useParams();
  const { fetchRoomData } = useRoom();
  const [room, setRoom] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadRoom = async () => {
      setLoading(true);
      const data = await fetchRoomData(roomId);
      setRoom(data);
      setLoading(false);
    };

    loadRoom();
  }, [roomId]);

  if (loading) return (
    <div className="loading-container">
      <div className="loading-spinner"></div>
      <p>Loading room data...</p>
    </div>
  );

  if (!room) return (
    <div className="error-container">
      <h2>Room not found</h2>
      <p>The room you're looking for doesn't exist or may have been deleted.</p>
    </div>
  );

  const profiles = room.profiles || {};

  return (
    <div className="room-page">
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Room: <span>{room.RoomID}</span></h1>
            <p className="creator-info">Created by: <span>{room.creatorID}</span></p>
          </div>
          <div className="header-actions">
            <button className="add-profile-btn">
              <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M12 4V20M4 12H20" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
              </svg>
              Add Profile
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {Object.values(profiles).length > 0 ? (
          <div className="profile-grid">
            {Object.values(profiles).map((profile, idx) => (
              <div className="profile-card" key={idx}>
                <div className="card-header">
                  <h3>{profile.name}</h3>
                  <span className="email-badge">{profile.email}</span>
                </div>
                <div className="card-body">
                  <p className="profile-desc">{profile.description || 'No description provided'}</p>
                </div>
                <div className="card-footer">
                  <button className="view-btn">View Details</button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">
              <svg width="48" height="48" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M16 7C16 9.20914 14.2091 11 12 11C9.79086 11 8 9.20914 8 7C8 4.79086 9.79086 3 12 3C14.2091 3 16 4.79086 16 7Z" stroke="#4B5563" strokeWidth="2"/>
                <path d="M16 15H8C5.79086 15 4 16.7909 4 19V21H20V19C20 16.7909 18.2091 15 16 15Z" stroke="#4B5563" strokeWidth="2"/>
              </svg>
            </div>
            <h3>No profiles yet</h3>
            <p>Add the first profile to get started</p>
            <button className="add-profile-btn primary">
              <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M12 4V20M4 12H20" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
              </svg>
              Add Profile
            </button>
          </div>
        )}

        {Object.values(profiles).length > 0 && (
          <div className="generate-teams-container">
            <button className="generate-teams-btn">
              <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M17 21V19C17 17.9391 16.5786 16.9217 15.8284 16.1716C15.0783 15.4214 14.0609 15 13 15H5C3.93913 15 2.92172 15.4214 2.17157 16.1716C1.42143 16.9217 1 17.9391 1 19V21M23 21V19C22.9993 18.1137 22.7044 17.2528 22.1614 16.5523C21.6184 15.8519 20.8581 15.3516 20 15.13M16 3.13C16.8604 3.3503 17.623 3.8507 18.1676 4.55231C18.7122 5.25392 19.0078 6.11683 19.0078 7.005C19.0078 7.89317 18.7122 8.75608 18.1676 9.45769C17.623 10.1593 16.8604 10.6597 16 10.88M13 7C13 9.20914 11.2091 11 9 11C6.79086 11 5 9.20914 5 7C5 4.79086 6.79086 3 9 3C11.2091 3 13 4.79086 13 7Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
              Generate Teams
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default RoomPage;
